/**
 * Represents the contract for data errors
 */
interface IDataError {
    /**
     * CorrelationId associated with the error response
     */
    correlationId: string;
    /**
     * CorrelationDate associated with the error response
     */
    correlationDate: string;
    /**
     * errorMessage associated with the error response
     */
    errorMessage: string;
}
export default IDataError;
